import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Top from "./Components/Top";
import ControlCard from "./Components/ControlCard";

function App() {
  const titleArray = ["Logistic", "E-Commerce", "Banking"];

  return (
    <div>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        {/* <a className="App-link" href="https://reactjs.org" target="_blank">
          Learn React
        </a> */}
        <Top subtitle={"aaaaaaaa"} />
      </header>

      <div className="container text-center">
        <div className="row">
          {titleArray.map((eachTitleArray) => (
            <div key={eachTitleArray} className="col">
              <ControlCard title={eachTitleArray} />
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default App;
